  useEffect(()=>{
    if(!userId){
      setError("Please Login First")
      return;
    }
    const data={userId:userId}
    const response=axios.post("http://localhost:8009/api/cartList",data)
    .then((res)=>{
      if(res.data.status){
        setCart(res.data.result)
      }
    }).catch((err)=>{
      console.log(err)
    })
  },[userId])
